import React, { useEffect, useState } from 'react';
import { makeStyles } from '@mui/styles';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { Button, Dialog, ListItemText, ListItem, List, Divider, AppBar, Toolbar, IconButton, Typography } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import { categoryOptionsMap } from '../resources/constants.jsx';
import SearchList from '../components/SearchList';

const useStyles = makeStyles(theme => ({

}));

function CategoryOptionsDialog({ category, doSearch, open, fullScreen=false, handleClose }) {
    const classes = useStyles();
    const location = useLocation();
    const navigate = useNavigate();

    const renderDialogHeader = () => {
        return (
            <AppBar sx={{ position: 'fixed' }}>
                <Toolbar>
                    <IconButton
                        edge="start"
                        color="inherit"
                        onClick={handleClose}
                        aria-label="close"
                    >
                    <CloseIcon />
                    </IconButton>
                    <Typography sx={{ ml: 2, flex: 1 }} variant="h6" component="div">
                        {category}
                    </Typography>
                    <Button autoFocus color="inherit" onClick={handleClose}>
                    save
                    </Button>
                </Toolbar>
            </AppBar>
        );
    };

    return (
        <Dialog
            fullScreen={fullScreen}
            open={open}
            onClose={handleClose}
        >
            {renderDialogHeader()}   
            <SearchList fullScreen={fullScreen} list={categoryOptionsMap[category]} search={doSearch} /> 
      </Dialog>
    );
}

export default CategoryOptionsDialog;
